import { render } from "@testing-library/react";

function App() {
  render()
  const title="User App";
  const isAuthorized=true;
  return (
    <div className="container">
      <h5>{title}</h5>
      {
        isAuthorized ? <p>Authorized</p> : <p>Not Authorized</p>
      }
    </div>
  );
}

export default App;
